import React from 'react';
import Images from '../src/screen/ImageList'

function App() {
  const auth = localStorage.getItem('Authorization')
  return (
    <React.Fragment>
      <nav className='nav-wrapper'>
        <ul>
          <li>gidiShare</li>
          <li>auth ? </li>
        </ul>
      </nav>

    </React.Fragment>
  )
}

export default App;
